const Navigation = () => {
  return (
    <>
    <Logo></Logo>
    <Sidenav></Sidenav>
    </>
  )
}




let Logo =()=>{

  return(
    <div className="logo">
     <img src="" alt="" className="logo-image"/>
    </div>
  )
}
let Sidenav =()=>{

  return(
    <div className="navbar">
      <div className="nav"><img src="" alt="" className="nav-image"/></div>
      <div className="nav"><img src="" alt="" className="nav-image"/></div>
      <div className="nav"><img src="" alt="" className="nav-image"/></div>
    </div>
  )
}

export default Navigation
